import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50 font-sans">
        <nav className="bg-blue-600 text-white p-4 flex justify-between items-center">
          <h1 className="text-xl font-bold">Magic Utility Club</h1>
          <div className="space-x-4">
            <Link to="/" className="hover:underline">Home</Link>
            <Link to="/rtgs-forms" className="hover:underline">RTGS / NEFT Forms</Link>
          </div>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/rtgs-forms" element={<RTGSForms />} />
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  const features = [
    'Banking Forms / Tools',
    'Cheque Printing Tools',
    'Invoice Formats',
    'Salary Slip Format',
    'Balance Sheet Format',
    'Tally Guide'
  ];

  return (
    <div className="p-6">
      <h2 className="text-2xl font-semibold mb-4">Purpose of the Site</h2>
      <ul className="list-disc ml-6 space-y-2">
        {features.map((feature, index) => (
          <li key={index}>{feature}</li>
        ))}
      </ul>
    </div>
  );
}

function RTGSForms() {
  const banks = [
    {
      name: 'Axis Bank Limited',
      items: ['Excel File Aito Utilities', 'PDF Form']
    },
    {
      name: 'Bank of Baroda',
      items: ['Excel File Aito Utilities', 'PDF Form']
    },
    {
      name: 'Canara Bank',
      items: ['Excel File Aito Utilities', 'PDF Form']
    }
  ];

  return (
    <div className="p-6">
      <h2 className="text-2xl font-semibold mb-4">RTGS / NEFT Forms</h2>
      {banks.map((bank, index) => (
        <div key={index} className="mb-6">
          <h3 className="text-lg font-bold text-blue-700 mb-2">{bank.name}</h3>
          <ul className="list-disc ml-6">
            {bank.items.map((item, idx) => (
              <li key={idx}>{item}</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}

export default App;
